import React from 'react';

// Base skeleton component
const Skeleton = ({ 
  className = '', 
  height = 'h-4', 
  width = 'w-full',
  rounded = 'rounded',
  animated = true 
}) => (
  <div 
    className={`
      ${height} 
      ${width} 
      ${rounded} 
      bg-gray-200 
      ${animated ? 'animate-pulse' : ''} 
      ${className}
    `}
    aria-label="Se încarcă conținutul"
    role="status"
  />
);

// Product card skeleton
export const ProductCardSkeleton = ({ className = '' }) => (
